import React from 'react'
import { NavLink } from 'react-router-dom'

const Header = () => {
    return (
        <header>
           <h1> Blog App</h1>
           <NavLink to="/"></NavLink>
           <NavLink to="/blogs"></NavLink>
           <NavLink to=""></NavLink>
        </header>
    )
}

export default Header
